import React from "react";
import Help from "./Help";

const Grade = () => {
  return (
    <section className="grade--section">
      <h1 className="title"> Grade Calculator</h1>
      <div className="interactions">
        <div className="inputs">
          <div className="assignment-inputs">
            <label className="label">Assignments</label>
            <input className="input assName"></input>
            {/* Add more inputs for assignments */}
          </div>
          <div className="grade-inputs">
            <label className="label">Grade %</label>
            <input className="input gradeNum"></input>
            {/* Add more inputs for grades */}
          </div>
          <div className="weight-inputs">
            <label className="label">Weight %</label>
            <input className="input weightNum"></input>
            {/* Add more inputs for weights */}
          </div>
        </div>

        <div className="outputs"></div>
      </div>
    </section>
  );
};

export default Grade;
